import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <nav className="header__nav">
        <a href="#about-us">About Us</a>
        <a href="#services">Services</a>
        <a href="#contact-us">Contact Us</a>
      </nav>
    </header>
  );
};

export default Header;
